ISLAMABAD, Mar 08 (APP): Prime Minister Shehbaz Sharif Friday attended a dinner hosted by Chairman Pakistan Peoples Party Bilawal Bhutto Zardari in honour of leaders of allied parties, Senators and elected representatives.
The prime minister reiterated his complete support to Co-Chairperson Pakistan Peoples Party Asif Ali Zardari in the presidential election.
